import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import './App.css';

import "primereact/resources/themes/saga-orange/theme.css";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>

    <h1 className="title">
      WELCOME TO APP
    </h1>
    <App />
    </>
);

